import React, { useState, useEffect } from 'react'
// import houselisting from '../assets/mocks/data'
import ListingCard from '../components/ListingCard'
import MapContainer from '../components/MapContainer'
import sf_housing_data from '../assets/mocks/sf_housing_data.json'


export default function listing() {
    let results;
    let house_results;
    if (sf_housing_data.length > 0) {
      // results = houselisting.map((house, index) => 
      // <ListingCard key={house.sys.id} {...house} />);

      results = sf_housing_data.map ((houses) =>
      // <ListingCard key={houses} {...house} />);
       {
          if (!!houses.zpid) {
            //with zpid
          return  <ListingCard key={houses.zpid} {...houses} />
          } else {
            //with buildingId
          return <ListingCard key={houses.buildingId} {...houses} />
          }
       }

      );
    } else {
      results = (
        <div>
          <h2>Sorry!</h2>
          <h3> No listings available yet.</h3>
        </div>
      );
    }

    return ( 
        <div id="content" style={{display: "flex"}}>  
          <div className="listings-container" style={{flex: "50%"}}>
            {results}
          </div>
          <div className="map-container" style={{flex: "50%"}}>
            <MapContainer/>
          </div>
        </div>
  )
}
